import axios from "axios";
const API_URL = "http://localhost:8000/api/";

const register = (username, email, password, name) => {
   return axios.post(API_URL + "/register", {
      username,
      email,
      password,
      name,
   });
};

const login = () => {};

const logout = () => {};

const authService = {
   register,
   login,
   logout,
};

export default authService;
